import React from 'react';
import { ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert, Button } from 'react-native';

export default function App() {
  return (
    state={
      color:'red'
    },
  <View style={styles.container}>
  <Button style={styles.button} 
  title="PRESSME"
  onPress={()=>styles.button.color=this.state.color}
  ></Button>  
  </View>
  );
}

const styles = StyleSheet.create({
  container:{
justifyContent:'center',
alignItems:'center',
flex:1,
  },
  button:{
    color:'red',
  justifyContent:'center',
  alignItems:'center',
},
});
